trailingComments.value:
while(str == null){
  if(this._partialText.length > this._partialMaxLength)
    return null

  this.addPartialText()
  str = this._partialText.match(pattern)
}

leadingComments.value:
while(str == null){
  if(this._partialText.length > this._partialMaxLength)
    return null

  this.addPartialText()
  str = this._partialText.match(pattern)
}

const str = this._text.match(this._skipPattern)
if(str != null){
  const len = str[0].length
  this.moveIndex(len)
}

comments.value:
while(str == null){
  if(this._partialText.length > this._partialMaxLength)
    return null

  this.addPartialText()
  str = this._partialText.match(pattern)
}

const str = this._text.match(this._skipPattern)
if(str != null){
  const len = str[0].length
  this.moveIndex(len)
}
